import React, {useEffect, useState} from 'react'
import { signup } from '../functions/funciones'


export const Inicio = () => {

  const [user, setUser] = useState(null)

  useEffect(()=> {
    signup(setUser)
  },[])

  return (
    <>
    {user != null ? ('Si hay usuario') :('No hay usuario')}

    </>
  )
}

export default Inicio
